import React from 'react'
import ClassApi from '../api/classapi.js'



export default class CharSheet extends React.Component {
	state = {
		name: '',

	}

	nameChange = (event) => {
		this.setState({
		name: event.target.value
	})}

	render(){
		return(
			<div>
			<form>
				<input 
				type='text'
				value={this.state.name}
				placeholder='rolfor'
				onChange={this.nameChange}
				/>
				<br/>
				<ClassApi/>
			</form>
			</div>
			)
	}

}
